import React from 'react'

const TransHistory = ({ transHistory }) => {

  return (
    <div>
     {Object.keys(transHistory).filter(key => key === 'Amount', key === 'Time', key === 'Transaction Type').map((item,i) => (
        <div>
            <h6 key={i} class="card-title">{transHistory[item]}</h6>
        </div>
      ))}
      
    </div>
  )
};

export default TransHistory;
